                type: \'GET\',
                dataType: \'jsonp\',
                success: function (data) {
                    setRedesInfo(data.count, red);
                }
            });
        }

        function getInfoAjax(url, red) {
            $.ajax({
                url: url,
                type: \'GET\',
                success: function (data) {
                    setRedesInfo(data, red);
                }
            });
        }

        function setRedesInfo(data, red) {
            var total = parseInt($(\'#totalShares\').attr(\'totalShares\'));
            var count = 0;

            switch (red) {
                case \'facebookShares\':
                    count = parseInt(data.shares || 0, 10);
                    break;
                case \'twitterShares\':
                    count = parseInt(data || 0, 10);
                    break;
                case \'googleShares\':
                    try {
                        count = parseInt((data[0].result.metadata.globalCounts.count) || 0, 10);
                    } catch (e) {
                        count = 0;
                    }
                    break;
            }

            $(\'#\' + red).text(count);

            total = total + count;
            $(\'#totalShares\').attr(\'totalShares\', total);
            $(\'#totalShares\').text(total);

            if (total > 100) {
                $(\'#barraTotalesRRSS\').attr(\'class\', \'totales\');
                $(\'#totalSharesDiv\').attr(\'class\', \'interacc\');
            }

            if (total > 10000) {
                totalMiles = Math.round(total / 1000);
                $(\'#totalShares\').text(totalMiles + \'k\');
            }
        }


        $(\'.votoValora\').click(function () {
            $(\'#participaValora\').css(\'display\', \'block\');
            setTimeout(function () {
                $(\'#participaValora\').css(\'display\', \'none\');
            }, 4000);
        });

        $(\'#participaValora\').click(function () {
            $(this).css(\'display\', \'none\');
        });

        var dispositivo = navigator.userAgent.toLowerCase();
        if ((dispositivo.search(/iphone/) > -1) || (dispositivo.search(/android/) > -1))
        {
            $(\'.wapp\').css(\'display\', \'block\');
        }
        
        try {
            if(typeof(user.nickname) !== "undefined")
            {
                $(\'#userSesionComentarioEskup\').css(\'display\', \'none\');
            }
        } catch (e) {
            
        }

    });
</script> 


